package seleniumClass;

public class postpreincrement {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=25;
		System.out.println(a);
		a++;
		a++;
		System.out.println(a);
		++a;
		++a;
		System.out.println(a);
		a++;
		++a;
		System.out.println(a);
		

	}

}
